import React from "react";

import Tile from "../tile/Tile.js";

export const TileList = ({ tiles }) => {



  return (
    <div>
      {tiles.map({ name, ...rest }, index => {
        <Tile 
          key={index} 
          name={tile.name} 
          description={rest} 
          /> 
      })}
    </div>
  );
};
